pragma solidity ^0.5.7;

import {Oracle} from './Oracle.sol';

contract Auction{
    // static
    address public owner;
    uint public bidIncrement;
    uint public endBid;
    uint public BidNum=0;
    
    // state
    uint state=0;
    bool public canceled;
    address public highestBidder;
    uint highestBid;
    mapping(address => uint256) public fundsByBidder;
    
    bool ownerHasWithdrawn;
    event track(address,uint, uint, string, address);
    event LogBid(address bidder, uint bid, address highestBidder, uint highestBid);
    event LogWithdrawal(address withdrawer, address withdrawalAccount, uint amount);
    event LogCanceled();
    event allInfo(address owner, uint bidNum, uint endBid,address highestBidder, uint highestBid, uint state);
    //newadd
    event AuctionCnt(uint cnt);
    
    // 輔助的event，沒有也不影響功能
    event newMyOracleQuery(string description);
    event Result(string result);
    event isDone(address);

    event settingResolver(address);

    Oracle oracle;
    event logResolver(address);

    constructor (address _owner, uint _endBid, address _oracle) public{
        owner = _owner;
        endBid = _endBid;
        oracle = Oracle(_oracle);
        emit allInfo(owner, BidNum, endBid, highestBidder, highestBid, state);
    }


    function getHighestBid()public
        view
        returns (uint)
    {
        return fundsByBidder[highestBidder];
    }

    function placeBid()public
        payable
        onlyBeforeEnd
        onlyNotCanceled
        onlyNotOwner
        enoughAmount
        largerThanBefore
        returns (bool success) 
    { 
        highestBidder = msg.sender;
        highestBid=msg.value;
        fundsByBidder[highestBidder]+=highestBid;
    
        oracle.operationCallback(msg.sender, "Placed a Bid!", address(this));
        BidNum++;
        emit LogBid(msg.sender, msg.value, highestBidder, fundsByBidder[highestBidder]);
        emit AuctionCnt(BidNum);
        emit allInfo(owner, BidNum, endBid, highestBidder, highestBid, state);

        return true;
        
    }


    function cancelAuction()
        onlyOwner
        onlyBeforeEnd
        onlyNotCanceled
        public
        returns (bool success)
    {
        canceled = true;
        oracle.operationCallback(msg.sender, "Canceled an Auction", address(this));
        emit LogCanceled();
        emit allInfo(owner, BidNum, endBid, highestBidder, highestBid, state);

        return true;
    }

    function withdraw()
        onlyEndedOrCanceled
        notHighestBidder
        notWithdrawYet
        public
        returns (bool success)
    {
        //this function is runned by frontend when it has triggered as auction ended or canceled by a user
        address withdrawalAccount;
        uint withdrawalAmount;

        if (canceled) {
            //withdraw the money if it is canceled
            withdrawalAccount = msg.sender;
            withdrawalAmount = fundsByBidder[withdrawalAccount];
        } else {
            if (msg.sender == owner) {
                //only owner can withdraw the highestBidder money
                withdrawalAccount = highestBidder;
                withdrawalAmount = fundsByBidder[highestBidder];
                ownerHasWithdrawn = true;
            } else {
                //others except the highest bidder can get the money
                withdrawalAccount = msg.sender;
                withdrawalAmount = fundsByBidder[withdrawalAccount];
            }
        }

        if (!msg.sender.send(withdrawalAmount)) revert();
        emit allInfo(owner, BidNum, endBid, highestBidder, highestBid, state);
        emit LogWithdrawal(msg.sender, withdrawalAccount, withdrawalAmount);
        fundsByBidder[withdrawalAccount] = 0;   //if it has refunded, reset the money as 0 so that it won't compute this function again
        oracle.operationCallback(withdrawalAccount, "Withdrawed Money", address(this));
        return true;
    }

    modifier onlyOwner {
        if (msg.sender != owner) revert();
        _;
    }

    modifier onlyNotOwner {
        if (msg.sender == owner) revert();
        _;
    }

    modifier enoughAmount{
        if(msg.sender.balance<fundsByBidder[highestBidder] + msg.value) revert(); //check if the user has sufficient amount to bid
        _;
    }

    modifier largerThanBefore{
        if(msg.value<=fundsByBidder[highestBidder])revert();
        _;
    }

    modifier onlyBeforeEnd {
        if (BidNum > endBid) revert();
        _;
    }

    modifier onlyNotCanceled {
        if (canceled) revert();
        _;
    }

    modifier onlyEndedOrCanceled {
        if (BidNum < endBid && !canceled) revert();
        _;
    }
    
    modifier notHighestBidder{
        if(msg.sender==highestBidder) revert();
        _;
    }
    
    modifier notWithdrawYet{    //check if the user is withdrawn or not
        if((owner!=msg.sender&&fundsByBidder[msg.sender]==0)||(owner==msg.sender&&fundsByBidder[highestBidder]!=0)) revert();
        _;
    }
    
    function getIsEnd()public returns (bool){   //determine if it is ended
        if(canceled||BidNum>=endBid){
            return true;
        }
        return false;
    }
}
